import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import Menu from "@mui/material/Menu";
import MenuIcon from "@mui/icons-material/Menu";
import Container from "@mui/material/Container";
import Button from "@mui/material/Button";
import MenuItem from "@mui/material/MenuItem";
import HomeIcon from "@mui/icons-material/Home";
import { useNavigate } from "react-router-dom";
import { useAuthenticate } from "../contexts/AuthContext";

const WEB_NAME = "Funny Movies";

function ResponsiveAppBar() {
  const navigate = useNavigate();
  const { user, isAuthenticated, logOut } = useAuthenticate();

  const [anchorElNav, setAnchorElNav] = React.useState<null | HTMLElement>(
    null
  );

  const handleOpenNavMenu = (event: React.MouseEvent<HTMLElement>) => {
    setAnchorElNav(event.currentTarget);
  };

  const onClickLogin = () => {
    navigate("/login");
    handleCloseNavMenu();
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const truncateEmail = (source: string | undefined, length: number) => {
    if (!source) return null;

    if (source.length <= length + 3) {
      return source
    } else {
      return source.substring(0, Math.max(length)) + '...'
    }
  }

  return (
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <HomeIcon sx={{ display: { xs: "none", md: "flex" }, mr: 1 }} />
          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: "none", md: "flex" },
              fontFamily: "monospace",
              fontWeight: 700,
              letterSpacing: ".3rem",
              color: "inherit",
              textDecoration: "none",
            }}
          >
            {WEB_NAME}
          </Typography>

          <Box sx={{ flexGrow: 1, display: { xs: "flex", md: "none" } }}>
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleOpenNavMenu}
              color="inherit"
            >
              <MenuIcon />
            </IconButton>
            <Menu
              id="menu-appbar"
              anchorEl={anchorElNav}
              anchorOrigin={{
                vertical: "bottom",
                horizontal: "left",
              }}
              keepMounted
              transformOrigin={{
                vertical: "top",
                horizontal: "left",
              }}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
              sx={{
                display: { xs: "block", md: "none" },
              }}
            >
              {!isAuthenticated() && (
                <MenuItem key="login" onClick={onClickLogin}>
                  <Typography textAlign="center">Login / Registry</Typography>
                </MenuItem>
              )}
              {isAuthenticated() && (
                <>
                  <MenuItem key="logout" onClick={handleCloseNavMenu}>
                    <Typography textAlign="center">Logout</Typography>
                  </MenuItem>

                  <MenuItem key="share movie" onClick={handleCloseNavMenu}>
                    <Typography textAlign="center">Share a Movie</Typography>
                  </MenuItem>

                  <MenuItem key="current user" onClick={handleCloseNavMenu}>
                    <Typography>{truncateEmail(user?.email, 10)}</Typography>
                  </MenuItem>
                </>
              )}
            </Menu>
          </Box>
          <HomeIcon sx={{ display: { xs: "flex", md: "none" }, mr: 1 }} />
          <Typography
            variant="h5"
            noWrap
            component="a"
            href=""
            sx={{
              mr: 2,
              display: { xs: "flex", md: "none" },
              flexGrow: 1,
              fontFamily: "monospace",
              fontWeight: 700,
              letterSpacing: ".3rem",
              color: "inherit",
              textDecoration: "none",
            }}
          >
            {WEB_NAME}
          </Typography>
          <Box
            sx={{
              flexGrow: 1,
              display: { xs: "none", md: "flex", flexDirection: "row-reverse" },
            }}
          >
            {!isAuthenticated() && (
              <Button
                onClick={onClickLogin}
                sx={{ my: 2, color: "white", display: "block" }}
              >
                Login / Register
              </Button>
            )}

            {isAuthenticated() && (
              <>
                <Button
                  onClick={handleCloseNavMenu}
                  sx={{ my: 2, color: "white", display: "block" }}
                >
                  Logout
                </Button>

                <Button
                  onClick={handleCloseNavMenu}
                  sx={{ my: 2, color: "white", display: "block" }}
                >
                  Share a Movie
                </Button>
                <Typography sx={{ mr: 3, my: 2, color: "white", display: "block", transform: 'translateY(5px)' }}>
                  Welcome {user?.email}
                </Typography>
              </>
            )}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}
export default ResponsiveAppBar;
